import Box from '@mui/material/Box';
import Button from '@mui/material/Button';

function App() {
  return (
    <div className="App">
        <Box sx={{ '& button': { m: 1 } }}>
          <Button variant="contained">Default</Button>
          <Button variant="contained" disabled>
            Disabled
          </Button>
          <Button variant="contained" href="#contained-buttons">
            Link
          </Button>
        </Box>

    </div>
  );
}

export default App;
